import React, { useState } from 'react'
import Charts from 'react-apexcharts'

const CardGraph = () => {
    const [Data] = useState(
        {
            options: {
                chart:{
                    background:'#fff',
                    type:"radialBar",
                    dropShadow:{
                        enabled: true,
                        enabledOnSeries: undefined,
                        top: 0,
                        left: 0,
                        blur: 3,
                        color: '#000',
                        opacity: 0.35
                    }
                }
            },
            series: [44, 55, 41, 17, 15],
            labels: ['A', 'B', 'C', 'D', 'E']
        }
    )
    return (
        <div>
              <Charts options={Data.options} series={Data.series}  width="380" />
        </div>
    )
}

export default CardGraph
